import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for at least one product price to appear (using .product-price class)
    await page.waitForSelector('.product-price', { timeout: 5000 });

    // Take a screenshot of the product grid area if present
    const productsGrid = await page.$('.products-grid');
    if (productsGrid) {
      await productsGrid.screenshot({ path: path.join(screenshotsDir, 'step_2_products_grid.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_products_grid.png'));
    }

    // Extract all visible product prices
    const prices = await page.$$eval('.product-price', nodes =>
      nodes.map(node => {
        // Extract price text, ignore original price (line-through)
        // Only get the first text node (the main price)
        const priceText = node.childNodes[0]?.textContent?.trim() || node.textContent.trim();
        // Remove $ and commas, parse as float if possible
        const match = priceText.match(/[\d,.]+/);
        return match ? match[0] : priceText;
      })
    );

    // Also try to extract prices from any product cards in list view
    const listPrices = await page.$$eval('.product-card-list .product-price', nodes =>
      nodes.map(node => {
        const priceText = node.childNodes[0]?.textContent?.trim() || node.textContent.trim();
        const match = priceText.match(/[\d,.]+/);
        return match ? match[0] : priceText;
      })
    );

    // Combine and deduplicate prices
    const allPrices = Array.from(new Set([...prices, ...listPrices])).filter(p => !!p);

    // Take a screenshot of the first product card if present
    const firstProductCard = await page.$('.product-card');
    if (firstProductCard) {
      await firstProductCard.screenshot({ path: path.join(screenshotsDir, 'step_3_first_product_card.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_first_product_card.png'));
    }

    return {
      success: true,
      action: "Extracted all visible product prices from the page",
      extractedData: {
        prices: allPrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
